import React, { useState } from 'react';
import models from './data/models.json';
import LeftSidebar from './components/LeftSidebar';
import RightSidebar from './components/RightSidebar';
import Layout from './components/Layout';

export default function App() {
  const defaultModel = models.find((model) => model.name === 'Health Belief Model (HBM)');
  const [selectedModel, setSelectedModel] = useState(defaultModel);
  const [selectedKeyword, setSelectedKeyword] = useState(null);

  const handleModelSelect = (model) => {
    setSelectedModel(model);
    setSelectedKeyword(null);
  };

  const handleKeywordClick = (keyword) => {
    setSelectedKeyword(keyword);
    setSelectedModel(null);
  };

  return (
    <Layout
      header={
        <div style={{ textAlign: 'center', marginBottom: '1rem' }}>
          <h1
            style={{
              fontFamily: 'Montserrat, sans-serif',
              fontWeight: '600',
              color: '#333333',
              margin: 0,
            }}
          >
            Framework Finder
          </h1>
          <p
            style={{
              fontFamily: 'Fira Sans Extra Condensed, sans-serif',
              fontWeight: '300',
              fontSize: '1.2rem',
              color: '#555555',
              margin: 0,
              marginTop: '0.5rem',
            }}
          >
            Explore various conceptual frameworks used in public health and social work research.
          </p>
        </div>
      }
      leftSidebar={
        <LeftSidebar
          models={models}
          selectedModel={selectedModel}
          onKeywordClick={handleKeywordClick}
        />
      }
      main={
        <div
          style={{
            padding: '2rem',
            fontFamily: 'Fira Sans Extra Condensed, sans-serif',
            fontWeight: '300',
            color: '#333333',
          }}
        >
          {selectedModel ? (
            <>
              <h2
                style={{
                  fontFamily: 'Montserrat, sans-serif',
                  fontWeight: '600',
                  color: '#333333',
                  marginBottom: '1rem',
                }}
              >
                {selectedModel.name}
              </h2>
              <div style={{ textAlign: 'center', marginBottom: '1rem' }}>
                <img
                  src={selectedModel.image}
                  alt={selectedModel.name}
                  style={{
                    maxWidth: '100%',
                    height: 'auto',
                    borderRadius: '8px',
                    border: '1px solid #D3D3D3',
                  }}
                />
              </div>
              <table
                style={{
                  width: '100%',
                  borderCollapse: 'collapse',
                  fontSize: '1rem',
                  backgroundColor: '#FFFFFF',
                  color: '#333333',
                }}
              >
                <tbody>
                  <tr>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '500',
                        backgroundColor: '#F8F8F8',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      Description
                    </td>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '300',
                        fontSize: '0.8rem',
                        border: '1px solid #D3D3D3',
                        fontFamily: 'Montserrat, sans-serif',
                      }}
                    >
                      {selectedModel.description}
                    </td>
                  </tr>
                  <tr>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '500',
                        backgroundColor: '#F8F8F8',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      Citation
                    </td>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '300',
                        fontSize: '0.8rem',
                        border: '1px solid #D3D3D3',
                        fontFamily: 'Montserrat, sans-serif',
                      }}
                    >
                      {selectedModel.citation}
                    </td>
                  </tr>
                  <tr>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '500',
                        backgroundColor: '#F8F8F8',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      Reference
                    </td>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '300',
                        fontSize: '0.8rem',
                        border: '1px solid #D3D3D3',
                        fontFamily: 'Montserrat, sans-serif',
                      }}
                    >
                      {selectedModel.reference}
                    </td>
                  </tr>
                  <tr>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '500',
                        backgroundColor: '#F8F8F8',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      Source
                    </td>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '300',
                        fontSize: '0.8rem',
                        border: '1px solid #D3D3D3',
                        fontFamily: 'Montserrat, sans-serif',
                      }}
                    >
                      <a
                        href={selectedModel.url}
                        target="_blank"
                        rel="noopener noreferrer"
                        style={{
                          color: '#1E88E5',
                          textDecoration: 'none',
                        }}
                      >
                        {selectedModel.url}
                      </a>
                    </td>
                  </tr>
                  <tr>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '500',
                        backgroundColor: '#F8F8F8',
                        border: '1px solid #D3D3D3',
                      }}
                    >
                      Keywords
                    </td>
                    <td
                      style={{
                        padding: '0.5rem',
                        fontWeight: '300',
                        fontSize: '0.8rem',
                        border: '1px solid #D3D3D3',
                        fontFamily: 'Montserrat, sans-serif',
                      }}
                    >
                      {selectedModel.keywords.join(', ')}
                    </td>
                  </tr>
                </tbody>
              </table>
            </>
          ) : (
            <p
              style={{
                textAlign: 'center',
                padding: '2rem',
                fontFamily: 'Fira Sans Extra Condensed, sans-serif',
                fontWeight: '300',
                color: '#333333',
              }}
            >
              Please select a model to view its details.
            </p>
          )}
        </div>
      }
      rightSidebar={
        <RightSidebar
          models={models}
          selectedModel={selectedModel}
          selectedKeyword={selectedKeyword}
          onSelectModel={handleModelSelect}
        />
      }
      footer={
        <p
          style={{
            fontFamily: 'Fira Sans Extra Condensed, sans-serif',
            fontWeight: '300',
            textAlign: 'center',
            color: '#333333',
          }}
        >
          This website is solely for instructional and academic research purposes. All information 
          presented on this website belongs to the respective authors and/or publishers. Source content 
          was gathered using an artificial intelligence-driven large language model (ChatGPT 4o) and may 
          contain inaccuracies. Students and researchers are responsible for verifying the 
          accuracy of this information against original sources.
        </p>
      }
    />
  );
}
